import React from "react";

const Uleft = ({setCom}) => {
  return (
    <>
      <div className="">
        <div className="UserPic">
          <img src="default.jpg" className="pic"></img>
        </div>
        <div className="adminNav">
          <ul>
            <li onClick={()=>{setCom("dashboard")}}>Generate Key</li>
            <li onClick={()=>{setCom("profile")}}>Key Detail</li>
            <li onClick={()=>{setCom("api")}}>profile</li>
          </ul>
        </div>
      </div>
    </>
  );
};

export default Uleft;
